import logo from './logo.svg';
import './App.css';
import {ThemeProvider} from '@primer/react'


const theme = {
  colors: {
    canvas: {
      default: '#fff'
    }
  }
}

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Box bg="canvas.default"></Box>
      <Box sx={{bg: 'canvas.default'}}></Box>
    </ThemeProvider>
  );
}

export default App;
